$ivf_stimulation_chart_grid->StartRec = 1;
$ivf_stimulation_chart_grid->StopRec = $ivf_stimulation_chart_grid->TotalRecs; // Show all records

// Restore number of post back records
if ($CurrentForm && $ivf_stimulation_chart_grid->EventCancelled) {
	$CurrentForm->Index = -1;
	if ($CurrentForm->hasValue($ivf_stimulation_chart_grid->FormKeyCountName) && ($ivf_stimulation_chart->isGridAdd() || $ivf_stimulation_chart->isGridEdit() || $ivf_stimulation_chart->isConfirm())) {
		$ivf_stimulation_chart_grid->KeyCount = $CurrentForm->getValue($ivf_stimulation_chart_grid->FormKeyCountName);
		$ivf_stimulation_chart_grid->StopRec = $ivf_stimulation_chart_grid->StartRec + $ivf_stimulation_chart_grid->KeyCount - 1;
	}
}
$ivf_stimulation_chart_grid->RecCnt = $ivf_stimulation_chart_grid->StartRec - 1;
if ($ivf_stimulation_chart_grid->Recordset && !$ivf_stimulation_chart_grid->Recordset->EOF) {
	$ivf_stimulation_chart_grid->Recordset->moveFirst();
	$selectLimit = $ivf_stimulation_chart_grid->UseSelectLimit;
	if (!$selectLimit && $ivf_stimulation_chart_grid->StartRec > 1)
		$ivf_stimulation_chart_grid->Recordset->move($ivf_stimulation_chart_grid->StartRec - 1);
} elseif (!$ivf_stimulation_chart->AllowAddDeleteRow && $ivf_stimulation_chart_grid->StopRec == 0) {
	$ivf_stimulation_chart_grid->StopRec = $ivf_stimulation_chart->GridAddRowCount;
}

// Initialize aggregate
$ivf_stimulation_chart->RowType = ROWTYPE_AGGREGATEINIT;
$ivf_stimulation_chart->resetAttributes();
$ivf_stimulation_chart_grid->renderRow();
if ($ivf_stimulation_chart->isGridAdd())
	$ivf_stimulation_chart_grid->RowIndex = 0;
if ($ivf_stimulation_chart->isGridEdit())
	$ivf_stimulation_chart_grid->RowIndex = 0;
while ($ivf_stimulation_chart_grid->RecCnt < $ivf_stimulation_chart_grid->StopRec) {
	$ivf_stimulation_chart_grid->RecCnt++;
	if ($ivf_stimulation_chart_grid->RecCnt >= $ivf_stimulation_chart_grid->StartRec) {
		$ivf_stimulation_chart_grid->RowCnt++;
		if ($ivf_stimulation_chart->isGridAdd() || $ivf_stimulation_chart->isGridEdit() || $ivf_stimulation_chart->isConfirm()) {
			$ivf_stimulation_chart_grid->RowIndex++;
			$CurrentForm->Index = $ivf_stimulation_chart_grid->RowIndex;
			if ($CurrentForm->hasValue($ivf_stimulation_chart_grid->FormActionName) && $ivf_stimulation_chart_grid->EventCancelled)
				$ivf_stimulation_chart_grid->RowAction = strval($CurrentForm->getValue($ivf_stimulation_chart_grid->FormActionName));
			elseif ($ivf_stimulation_chart->isGridAdd())
				$ivf_stimulation_chart_grid->RowAction = "insert";
			else
				$ivf_stimulation_chart_grid->RowAction = "";
		}

		// Set up key count
		$ivf_stimulation_chart_grid->KeyCount = $ivf_stimulation_chart_grid->RowIndex;

		// Init row class and style
		$ivf_stimulation_chart->resetAttributes();
		$ivf_stimulation_chart->CssClass = "";
		if ($ivf_stimulation_chart->isGridAdd()) {
			if ($ivf_stimulation_chart->CurrentMode == "copy") {
				$ivf_stimulation_chart_grid->loadRowValues($ivf_stimulation_chart_grid->Recordset); // Load row values
				$ivf_stimulation_chart_grid->setRecordKey($ivf_stimulation_chart_grid->RowOldKey, $ivf_stimulation_chart_grid->Recordset); // Set old record key
			} else {
				$ivf_stimulation_chart_grid->loadRowValues(); // Load default values
				$ivf_stimulation_chart_grid->RowOldKey = ""; // Clear old key value
			}
		} else {
			$ivf_stimulation_chart_grid->loadRowValues($ivf_stimulation_chart_grid->Recordset); // Load row values
		}
		$ivf_stimulation_chart->RowType = ROWTYPE_VIEW; // Render view
